import React from 'react'
import Link from 'next/link'

const Contato = () => {
  return (
    <div>
      <h1 className='text-center'>CONTATOS</h1>
      <p className='text-center'>
        AQUI INFORMAÇÕES PERTIENTES AOS CONTATOS DO ESTABELECIMENTO.
      </p>
    </div>
  )
}
export default Contato
